import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import Countryside from '../images/countryside.png';
import Amazingpools from '../images/amazingpools.png';
import Nationalparks from '../images/nationalparks.png';
// Import other images here

interface ImageItem {
  src: string;
  text: string;
}

const images: ImageItem[] = [
  { src: Countryside, text: 'Countryside' },
  { src: Amazingpools, text: 'Amazing Pools' },
  { src: Nationalparks, text: 'National Parks' },
  // Add more images and texts here
];

const Menubar: React.FC = () => {
  return (
    <div className="w-full">
      <Carousel
        showThumbs={false}
        showStatus={false}
        infiniteLoop={true}
        autoPlay={true}
        interval={5000}
        transitionTime={500}
        stopOnHover={true}
      >
        {images.map((image, index) => (
          <div key={index} className="flex flex-col items-center justify-center">
            <img src={image.src} alt={image.text} className="w-32 h-32 object-cover rounded-full" />
            <h1 className="text-xs font-semibold mt-2">{image.text}</h1>
          </div>
        ))}
      </Carousel>
    </div>
  );
};

export default MenubarCarousel;
